import React, { Component } from 'react'
import './App.scss';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Project from './components/Project';
import About from './components/About';
import Home from './components/Home';
import Footer from './components/Footer';
import Navbars from './components/Navbars';
import Particles_component from './components/Particles_component'
export class App extends Component
{
  constructor()
  {
    this.state = { isLoading: true }
  }
  componentDidMount()
  {
    this.setState({ isLoading: false })
  }
  render()
  {
    return (

      <div className="App">
        <BrowserRouter>
          <div
            style={{
              position: "absolute",
              top: 0,
              left: 0,
              width: "100%",
              height: "100%"
            }}
          >
            <Particles_component />
            <div
              style={{
                position: "absolute",
                top: 0,
                left: 0,
                width: "100%",
                height: "100%"
              }}
            >
              <Navbars />
              <Switch>
                <Route exact path="/">
                  <Home />
                </Route>
                <Route exact path="/projects">
                  <Project />
                </Route>
                <Route path="/about">
                  <About />
                </Route>
              </Switch>
              <Footer />

            </div>
          </div>
        </BrowserRouter>
      </div>
    )
  }
}

export default App
